import React from 'react';
import { Button } from '@/components/ui/button';
import { Printer } from 'lucide-react';

const PDFPrintButton = () => {
  const handlePrint = async () => {
    try {
      // Create an iframe to load and print the PDF
      const printFrame = document.createElement('iframe');
      
      // Hide the iframe
      printFrame.style.display = 'none';
      document.body.appendChild(printFrame);
      
      // Set the PDF URL
      printFrame.src = 'https://venor-printing.s3.eu-north-1.amazonaws.com/1_1234.pdf';
      
      // Wait for the iframe to load
      printFrame.onload = () => {
        try {
          // Print the iframe content
          printFrame.contentWindow.print();
          
          // Remove the iframe after printing
          setTimeout(() => {
            document.body.removeChild(printFrame);
          }, 1000);
        } catch (error) {
          console.error('Print error:', error);
        }
      };
    } catch (error) {
      console.error('Error setting up print:', error);
    }
  };

  return (
    <Button 
      onClick={handlePrint}
      className="flex items-center gap-2"
    >
      <Printer className="w-4 h-4" />
      Print Document
    </Button>
  );
};

export default PDFPrintButton;
